script: |
  super -f text -I q6520.spq | sort > q6520.out

inputs:
  - name: q6520.spq
    data: |
      SELECT ALL * FROM tab0 (FORMAT parquet) WHERE NULL BETWEEN - col2 * - col0 / 39 + - - col2 - - CAST ( - + col1 AS INTEGER ) AND + 6 * + col1 + - col1 + 92 + - col2 - - col1;
  - name: tab0

outputs:
  - name: q6520.out
    data: |
